import React from 'react'
import { Navbar, Nav, Container } from 'react-bootstrap'

const Header = () => {
  return (
    <header>
      <Navbar bg='white' variant='white' expand='lg'>
        <Container></Container>
      </Navbar>
    </header>
  )
}

export default Header
